import React from 'react';
import QuoteItem from './QuoteItem';
import Spinner from '../layout/Spinner';

const Quotes = ({ quotes, count, loading }) => {
  return (
    <div className={quoteStyle}>
      <Spinner />
    </div>
  );
};

const quoteStyle = {
  display: 'flex',
  flexDirection: 'column'
};

export default Quotes;
